import json
import requests

from src.config.settings import CHAIN_ID, COVALENT_HOME
from src.metrics.metrics_main import calculate_metrics
from src.utils.lambda_function_utils import all_balances_for_address, stringify_keys
from src.transactions.transaction_classifier import classify_transactions


def lambda_handler(event, context):
    results = []
    api_key = event['api_key']

    _addresses = event['_addresses']
    addresses = _addresses.split(',') if isinstance(_addresses, str) else _addresses

    for address in addresses:
        address = address.lower()

        transactions = requests.get(
            f"https://{COVALENT_HOME}/{CHAIN_ID}/address/{address}/transactions_v2/?page-size=1500&key={api_key}"
        ).json()

        if not transactions['data']:
            return json.dumps(transactions, default=str)
        elif not transactions['data']['items']:
            return json.dumps({}, default=str)

        classified_transactions = classify_transactions(transactions)
        metrics = calculate_metrics(address, classified_transactions, api_key)

        results.extend([
            {"metrics": {key: value for key, value in metrics.items() if key not in ['token_history', 'token_balances']},
             "balances": {key: value for key, value in metrics.items() if key in ['token_history', 'token_balances']}
             }])
    results = stringify_keys(results)
    print(results)
    return json.dumps(results, default=str)

